<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Document</title>
</head>
<body>
    <div class="container">

        <form class="form" id="form" action="post.php" method="POST">
            <input class="input text" type="text" id="url" name="url" placeholder="Ссылка на страницу" required>
            <input class="input text" type="text" id="dirname" name="dirname" placeholder="Как назовём архив?" required>
            <input class="input btn" type="button" id="btn" value="Загрузить">
            <div class="loader" id="loader"><div class="lds-ellipsis"><div></div><div></div><div></div><div></div></div></div>
        </form>

        <a class="input download" title="" id="download" href="" download>Скачать архив</a>
    </div>

<script>
    const doc = document
    const btn = doc.querySelector('#btn')
    const url = doc.querySelector('#url')
    const dirname = doc.querySelector('#dirname')
    const download = doc.querySelector('#download')
    const loader = doc.querySelector('#loader')


    btn.addEventListener('click', ev => {

        fetch('post.php', {
            method: 'POST',
            body: new FormData( document.getElementById('form')),
        });
        
        download.classList.remove('active')
        btn.classList.add('disable')
        loader.classList.add('active')
        setTimeout(() => {
            download.classList.add('active')
            loader.classList.remove('active')
            btn.classList.remove('disable')
        }, 2000);
        
        let dirnameValue = dirname.value

        btn.setAttribute('href', dirnameValue  + '.zip')
        btn.setAttribute('title', dirnameValue  + '.zip')
    })

</script>

