        background-size: cover;
        min-height: 100vh;
        padding: 0;
        margin: 0;
    }

    a {
        text-decoration: none;
        color: inherit;
    }

    .container {
        max-width: 600px;
        width: 100%;
        margin: 0 auto;
        padding: 80px 20px;
    }

    .form {
        position: relative;
        display: flex;
        flex-direction: column;
        gap: 20px;
        margin-bottom: 20px;
    }

    .form input:first-child {
        border-radius: 5px 30px 0px 5px;
    }

    .form:valid .btn{
        visibility: visible;
        pointer-events: auto;
        opacity: 1;
        transition: all .5s;
    }

    .input {
        color: burlywood;
        background: darkslategrey;
        height: 40px;
        width: 100%;
        padding: 0 20px;
        border: none;
        border-radius: 5px;
    }

    .input:focus-visible {
        border: none;
        box-shadow: 0 0 14px 1px rgb(92 34 80);
        outline: none;
    }

    .btn {
        visibility: hidden;
        cursor: pointer;
        transition: all .5s;
        pointer-events: none;
        opacity: 0;
    }

    .btn:hover {
        color: cadetblue;
        transition: all .5s;
    }

    .form:valid  .btn.disable {
        pointer-events: none;
    }

    .btn:active {
        transform: scale(0.97);
        transition: all .5s;
    }

    .download {
        display: block;
        width: 100%;
        text-align: center;
        padding: 10px 0;
        visibility: hidden;
        cursor: pointer;
        transition: all .5s;
        pointer-events: none;
        opacity: 0;
    }

    .download:hover {
        color: cadetblue;
        transition: all .5s;
    }

    .download:active {
        transform: scale(0.97);
        transition: all .5s;
    }

    .download.active {
        visibility: visible;
        pointer-events: auto;
        opacity: 1;
        transition: all .5s;
    }

    /* Лоадер */

    .loader {
        position: absolute;
        right: 0;
        bottom: -55px;
        display: none;
    }

    .loader.active {
        display: block;
    }

    .lds-ellipsis {
        display: inline-block;
        position: relative;
        width: 80px;
        height: 80px;
    }

    .lds-ellipsis div {
        position: absolute;
        top: 33px;
        width: 13px;
        height: 13px;
        border-radius: 50%;
        background: #fff;
        animation-timing-function: cubic-bezier(0, 1, 1, 0);
    }

    .lds-ellipsis div:nth-child(1) {
        left: 8px;
        animation: lds-ellipsis1 0.6s infinite;
    }

    .lds-ellipsis div:nth-child(2) {
        left: 8px;
        animation: lds-ellipsis2 0.6s infinite;
    }

    .lds-ellipsis div:nth-child(3) {
        left: 32px;
        animation: lds-ellipsis2 0.6s infinite;
    }

    .lds-ellipsis div:nth-child(4) {
        left: 56px;
        animation: lds-ellipsis3 0.6s infinite;
    }

    @keyframes lds-ellipsis1 {
        0% {transform: scale(0);}
        100% {transform: scale(1);}
    }
    @keyframes lds-ellipsis3 {
        0% {transform: scale(1);}
        100% {transform: scale(0);}
    }
    @keyframes lds-ellipsis2 {
        0% {transform: translate(0, 0);}
        100% {transform: translate(24px, 0);}
    }
</style>

</body>
</html>
